import React from "react";
import ReactDOM from "react-dom";

function Card(props){
    return (
    <>
    <div className="cards">
      <div className="card">
        <img src="https://occ-0-2590-2186.1.nflxso.net/dnm/api/v6/X194eJsgWBDE2aQbaNdmCXGUP-Y/AAAABXzxzL3cQ09GzBAXe_RnuH_Eeo4w-x3K7wuEqoVQI064QatmaNwYMnduO9EjmJnANdd_38SeS5sMJ0pbYSALuAnfebU.jpg?r=5ac" alt="notshown" className="card__img" />
         <div className="card__info">
           <span className="card__category">Netflix originals series</span>
             <h3 className="card__title">Extraction</h3>
               <a href="{props.link}"  target="blank" >
                 <button>Watch Now</button>
               </a>
          </div>
       </div>
    </div>
    </>);
}



ReactDOM.render(
  <>
  <Card //imgsrc="https://occ-0-2590-2186.1.nflxso.net/dnm/api/v6/X194eJsgWBDE2aQbaNdmCXGUP-Y/AAAABXzxzL3cQ09GzBAXe_RnuH_Eeo4w-x3K7wuEqoVQI064QatmaNwYMnduO9EjmJnANdd_38SeS5sMJ0pbYSALuAnfebU.jpg?r=5ac"
     //sname="Extraction"
     //title="Netflix movie and series"
     //link="https://www.netflix.com/in/title/80230399"
     />
</>,
document.getElementById("root"));
